using System;
using System.Collections.Generic;
using UnityEngine;

namespace AillieoUtils.EasyBehaviorTree.Creator
{
    public enum PresetNodeIcons
    { 
        NodeBase,
        NodeAction,
        NodeCondition,
        NodeDecorator,
        NodeParallel,
        NodeSequence,
        NodeSelector,
    }


    public static class TextureAssets
    {
        private static readonly string NodeBase = "";

        private static readonly string NodeAction = "";

        private static readonly string NodeCondition = "";

        private static readonly string NodeDecorator = "";

        private static readonly string NodeParallel = "";

        private static readonly string NodeSequence = "";

        private static readonly string NodeSelector = "";

        private static Texture2D Base64ToTexture2D(string base64)
        {
            Texture2D tex = new Texture2D(1, 1);
            tex.LoadImage(Convert.FromBase64String(base64));
            tex.Apply();
            return tex;
        }

        public static Dictionary<PresetNodeIcons, Texture2D> TextureDict = new Dictionary<PresetNodeIcons, Texture2D>() 
        {
            { PresetNodeIcons.NodeBase, Base64ToTexture2D(NodeBase)},
            { PresetNodeIcons.NodeAction, Base64ToTexture2D(NodeAction)},
            { PresetNodeIcons.NodeCondition, Base64ToTexture2D(NodeCondition)},
            { PresetNodeIcons.NodeDecorator, Base64ToTexture2D(NodeDecorator)},
            { PresetNodeIcons.NodeSequence, Base64ToTexture2D(NodeSequence)},
            { PresetNodeIcons.NodeParallel, Base64ToTexture2D(NodeParallel)},
            { PresetNodeIcons.NodeSelector, Base64ToTexture2D(NodeSelector)},
        };
    }
}
